      {currentPage === 'fine-hair' && <FineHairProducts navigateTo={navigateTo} />}
      {currentPage === 'thick-hair' && <ThickHairProducts navigateTo={navigateTo} />}
      {showCart && <Cart cartItems={cartItems} closeCart={toggleCart} />}
    </div>
  );
}

export default App;
